Science Documentary hosted by Donald Sutherland, published by BSkyB in 2007 - English narration


Information
------------------------------

Dinosaurs: Giants of Patagonia 
Dinosaurs Giants Of Patagonia DVD, explore the history, evolution and extinction of some of the most captivating animals on earth. Donald Sutherland narrates this amazing documentary, which introduces you to some of the largest dinosaurs that ever existed. Then in the dinosaurs DVD, watch as modern science recreates the Giganotosaurus and the Argentinosaurus, and explore some of the greatest advances in paleontology. 

This fascinating film, Dinosaurs Giants Of Patagonia DVD, focuses on the history, evolution and extinction of the dinosaurs. In larger-than-life fashion, you will explore a subject matter whose mystique and appeal are unquestioned. In dinosaurs DVDs, dinosaurs are amongst the most fascinating animals to have ever walked the Earth. We are captivated by their enormous size and intrigued by the fact that they disappeared millions of years ago Dinosaurs: Giants of Patagonia will take you on an unprecedented and unique journey into the world of the largest known dinosaurs and, in the process, explore some of the great paleontological discoveries of modern time. Done in close collaboration with the foremost scientists of the domain, the movie will show never seen before computer generated footage of the Giganotosaurus and the Argentinosaurus to name a few. At the moment of initiating this extraordinary project, one question comes to mind: &quot;Is your screen big enough?&quot; Narrated by Donald Sutherland.

